import React from 'react';
import { useTranslation } from "react-i18next";

function Footer (){
    const { i18n } = useTranslation();

    return (
      <div className="footer">
            <img src="images/logo-white.svg" className="footer-logo" alt="" />
      </div>
  );
};

export default Footer;
